import React from "react";
import "./nav.css";
import home from "../assets/images/home.svg";
import NavButton from "./NavButton";
const Nav=()=>{
    const navigateHome=()=>{
        console.log("Home button clicked");

    }
    return(
        <nav>
            <ul>
                <li><NavButton className="navBtn" label="Home" name="homeBtn" onClick={navigateHome} /></li>
                <li><NavButton className="navBtn" label="Connections" name="conBtn"/></li>
                <li><NavButton className="navBtn" label="Search" name="searchBtn"/></li>
                <li><NavButton className="navBtn" label="Notifications" name="notiBtn"/></li>
                <li><NavButton className="navBtn" label="Profile" name="profileBtn"/></li>
            </ul>
        </nav>
    )
}
export default Nav;
